import { initializeApp } from 'firebase/app';
import { 
  getFirestore, collection, query, where
} from 'firebase/firestore';
import { Helmet } from 'react-helmet';
import {
  Box, Container, Grid, Button, TextField
} from '@material-ui/core';
import SamplesTable from '../components/client/Samples'
import Component from 'react';

const firebaseConfig = initializeApp({
  apiKey: 'AIzaSyC64KY9UehoX2fk7Ugw2XNPvG4zZ7sSdsQ',
  authDomain: 'uno-genomics.firebaseapp.com',
  databaseURL: 'https://uno-genomics-default-rtdb.firebaseio.com',
  projectId: 'uno-genomics',
  storageBucket: 'uno-genomics.appspot.com',
  messagingSenderId: '351603848354',
  appId: '1:351603848354:web:e974a024da6b7e7472d3fb'
});
const db = getFirestore();
async function get_samples() {
  const q = query(collection(db, 'samples'), where('user_id', '==', user)); 
const samples_ref = await getDocs(q);

let samples = [];
samples_ref.forEach((sample_data) => {
  let data = sample_data.data();
  let sample = []
  data.forEach((datum) => {
    sample.push(datum);
  });
  samples.push(sample);
})
}

class Dashboard extends Component {
  render() {
    return (
      <>
        <Helmet>
          <title>Dashboard | Material Kit</title>
        </Helmet>
        <Samples samples={samples}/>
      </>
    )
  }
}

export default Dashboard;
